create database music_database;
use music_database;
-- Core Music Tables
create table artist(
artist_id int PRIMARY KEY,
name varchar(250)
);


create table album(
album_id int PRIMARY KEY,
title varchar(250),
artist_id int,
FOREIGN KEY (artist_id) REFERENCES artist(artist_id)
);


create table genre(
genre_id int PRIMARY KEY,
name varchar(250)
);


create table media_type(
media_typ_id int PRIMARY KEY,
name varchar(250)
);


create table track(
track_id int PRIMARY KEY,
name varchar(250),
album_id INT,
media_type_id	INT,
genre_id	INT,
composer	VARCHAR(220),
milliseconds	INT,
bytes	INT,
unit_price	DECIMAL(10, 2)
);




-- Playlist Tables
create table playlist(
playlist_id int Primary Key,
name VARCHAR(250)
);

 

create table playlist_track(
playlist_id int ,
track_id int
);


