CREATE TABLE customer (
    customer_id     INT PRIMARY KEY,
    first_name      VARCHAR(50),
    last_name       VARCHAR(50),
    company         VARCHAR(100),
    address         VARCHAR(100),
    city            VARCHAR(50),
    state           VARCHAR(50),
    country         VARCHAR(50),
    postal_code     VARCHAR(20),
    phone           VARCHAR(30),
    fax             VARCHAR(30),
    email           VARCHAR(100),
    support_rep_id  INT,
    FOREIGN KEY (support_rep_id) REFERENCES employee(employee_id)
);




CREATE TABLE invoice (
    invoice_id          INT PRIMARY KEY,
    customer_id         INT,
    invoice_date        DATETIME,
    billing_address     VARCHAR(100),
    billing_city        VARCHAR(50),
    billing_state       VARCHAR(50),
    billing_country     VARCHAR(50),
    billing_postal_code VARCHAR(20),
    total               DECIMAL(10,2),
    FOREIGN KEY (customer_id) REFERENCES customer(customer_id)
);



CREATE TABLE invoice_line (
    invoice_line_id INT PRIMARY KEY,
    invoice_id      INT,
    track_id        INT,
    unit_price      DECIMAL(10,2),
    quantity        INT,
    FOREIGN KEY (invoice_id) REFERENCES invoice(invoice_id),
    FOREIGN KEY (track_id) REFERENCES track(track_id)
);




--  1. AGGREGATE FUNCTIONS ------------------------------------------

-- Q1: Find the total number of customers.
SELECT COUNT(*) AS total_customers FROM customer;

-- Q2: Find the total invoice amount for all invoices.
SELECT SUM(total) AS total_sales FROM invoice;

-- Q3: Find the average total amount of all invoices.
SELECT AVG(total) AS avg_invoice_total FROM invoice;

-- Q4: Find the smallest and largest invoice totals.
SELECT MIN(total) AS min_invoice, MAX(total) AS max_invoice FROM invoice;


--  2. STRING FUNCTIONS ---------------------------------------------

-- Q1: Show all customers names in uppercase.
SELECT UPPER(first_name) AS first_name_upper, UPPER(last_name) AS last_name_upper FROM customer;

-- Q2: Display customers full names in one column.
SELECT CONCAT(first_name, ' ', last_name) AS full_name FROM customer;

-- Q3: Extract the first 3 letters of each customers first name.
SELECT SUBSTRING(first_name, 1, 3) AS short_name FROM customer;

-- Q4: Convert all email addresses to lowercase.
SELECT LOWER(email) AS email_lower FROM customer;


--  3. DATE FUNCTIONS -----------------------------------------------

-- Q1: Extract the year from each invoice date.
SELECT invoice_id, YEAR(invoice_date) AS invoice_year FROM invoice;

-- Q2: Extract the month from each invoice date.
SELECT invoice_id, MONTH(invoice_date) AS invoice_month FROM invoice;

-- Q3: Find how many days ago each invoice was created.
SELECT invoice_id, DATEDIFF(NOW(), invoice_date) AS days_since_invoice FROM invoice;

-- Q4: Find invoices created in the current year.
SELECT * FROM invoice WHERE YEAR(invoice_date) = YEAR(NOW());


--  4. NUMERIC FUNCTIONS --------------------------------------------

-- Q1: Round each invoice total to 2 decimal places.
SELECT invoice_id, ROUND(total, 2) AS rounded_total FROM invoice;

-- Q2: Round each invoice total upward to the next integer.
SELECT invoice_id, CEIL(total) AS ceil_total FROM invoice;

-- Q3: Round each invoice total downward to the nearest integer.
SELECT invoice_id, FLOOR(total) AS floor_total FROM invoice;

-- Q4: Show the absolute difference between total and 10.
SELECT invoice_id, ABS(total - 10) AS abs_difference FROM invoice;


--  5. DISTINCT ------------------------------------------------------

-- Q1: Show all distinct countries where customers live.
SELECT DISTINCT country FROM customer;

-- Q2: Show distinct billing countries from the invoice table.
SELECT DISTINCT billing_country FROM invoice;

-- Q3: Find how many unique cities customers are from.
SELECT COUNT(DISTINCT city) AS unique_cities FROM customer;

-- Q4: List unique combinations of country and state.
SELECT DISTINCT country, state FROM customer;


--  6. LIMIT & ORDER BY ---------------------------------------------

-- Q1: Show the first 5 customers alphabetically by last name.
SELECT * FROM customer ORDER BY last_name ASC LIMIT 5;

-- Q2: Show the 5 most expensive invoices.
SELECT * FROM invoice ORDER BY total DESC LIMIT 5;

-- Q3: Show the latest 10 invoices.
SELECT * FROM invoice ORDER BY invoice_date DESC LIMIT 10;

-- Q4: Show the top 3 customers with the highest total invoices.
SELECT customer_id, SUM(total) AS total_spent
FROM invoice
GROUP BY customer_id
ORDER BY total_spent DESC
LIMIT 3;


--  7. WHERE ---------------------------------------------------------

-- Q1: Find customers from Canada.
SELECT * FROM customer WHERE country = 'Canada';

-- Q2: Find invoices greater than $20.
SELECT * FROM invoice WHERE total > 20;

-- Q3: Find customers whose first name starts with A.
SELECT * FROM customer WHERE first_name LIKE 'A%';

-- Q4: Find invoices between $10 and $15.
SELECT * FROM invoice WHERE total BETWEEN 10 AND 15;


--  8. JOINS ---------------------------------------------------------

-- Q1: Join customers and invoices to show each customers invoice details.
SELECT c.first_name, c.last_name, i.invoice_id, i.total
FROM customer c
JOIN invoice i ON c.customer_id = i.customer_id;

-- Q2: Show invoices with their invoice line totals.
SELECT i.invoice_id, il.unit_price, il.quantity
FROM invoice i
JOIN invoice_line il ON i.invoice_id = il.invoice_id;

-- Q3: Show all customers even if they have no invoices.
SELECT c.first_name, c.last_name, i.invoice_id
FROM customer c
LEFT JOIN invoice i ON c.customer_id = i.customer_id;

-- Q4: Count number of invoices per customer using join.
SELECT c.first_name, c.last_name, COUNT(i.invoice_id) AS invoice_count
FROM customer c
LEFT JOIN invoice i ON c.customer_id = i.customer_id
GROUP BY c.customer_id;


--  9. WINDOW FUNCTIONS ---------------------------------------------

-- Q1: Rank invoices by total within each billing country.
SELECT invoice_id, billing_country, total,
RANK() OVER (PARTITION BY billing_country ORDER BY total DESC) AS rank_in_country
FROM invoice;

-- Q2: Calculate running total of invoice totals.
SELECT invoice_id, invoice_date, 
SUM(total) OVER (ORDER BY invoice_date) AS running_total
FROM invoice;

-- Q3: Find average invoice total per country using a window.
SELECT invoice_id, billing_country, total,
AVG(total) OVER (PARTITION BY billing_country) AS avg_per_country
FROM invoice;

-- Q4: Assign row numbers to all invoices ordered by total descending.
SELECT invoice_id, ROW_NUMBER() OVER (ORDER BY total DESC) AS row_num
FROM invoice;


--  10. SUBQUERIES ---------------------------------------------------

-- Q1: Find customers who have invoices greater than $20.
SELECT * FROM customer
WHERE customer_id IN (
    SELECT customer_id FROM invoice WHERE total > 20
);

-- Q2: Find invoices with total greater than the average invoice total.
SELECT * FROM invoice
WHERE total > (SELECT AVG(total) FROM invoice);

-- Q3: Find customers who have made more than 5 invoices.
SELECT * FROM customer
WHERE customer_id IN (
    SELECT customer_id FROM invoice GROUP BY customer_id HAVING COUNT(*) > 5
);

-- Q4: Find the highest invoice total using a subquery.
SELECT * FROM invoice
WHERE total = (SELECT MAX(total) FROM invoice);

